import React from 'react';
import { useParams } from 'react-router-dom';
import ChatHeader from '../component/chatHeader';
import ChatPanel from '../component/chatPanel';

const notes = {
  MN: { name: 'My Notes', messages: ['Note 1', 'Note 2'] },
  MP: { name: 'My Personal Group', messages: ['Hey there!', 'Welcome!'] },
  JG: { name: 'Javascript Group', messages: ['const x = 10;', 'JS is fun!'] },
  HG: { name: 'HTML Group', messages: ['<h1>Hello</h1>'] },
  CN: { name: 'CSS Notes', messages: ['color: red;'] },
  SN: { name: 'SQL Notes', messages: ['SELECT * FROM users;'] },
  PN: { name: 'Python Notes', messages: ['print("Hello")'] }
};

const GroupChat = () => {
  const { groupId } = useParams();
  const group = notes[groupId];

  return (
    <div className='bg-[#DAE5F5] h-full w-full flex flex-col'>
      <ChatHeader initial={groupId} name={group.name} />
      <ChatPanel messages={group.messages} />
    </div>
  );
};

export default GroupChat;
